import awsconfig from "../src/aws-exports";
Amplify.configure(awsconfig);
export default class Page extends Component {
  render() {
    return (
      <>
        <Meta />
        <main className="content">
          <Header />
          {this.props.children}
          <Footer />
        </main>
      </>
    );
  }
}
